Description
Jennifer White, Nikki Delano, Ryder Skye, Claudia Valentine, Sean Michaels, Jon Jon, Mo Johnson, Tee Reel

Nikki and her husband are having a fight about which sex is superior. To prove her point, she makes her husband watch as she dominates Tee Reel. Sean is applying for a new job to be on assistant to Claudia and her husband. It doesn't take long for him to realize that he'll be helping Claudia out in a much more personal way than he thought. Ryder has been dying to hook up with Moe for ages now, and when she finally gets him home she won't let her loser husband stop her from fucking him like there is no tomorrow. Jennifer is expecting to go on a nice date with her husband, but he ends up disappointing her. To get back at him, she fucks his best friend right in front of his eyes!
